import CustomHttpService from './custom-http.service';
import Config from '../config/config';
import EncodeDecodeType from '../actiontype/encode-decode-type';
import { AppConstant } from '../constants/app.constant';
import CookieManagerService from './cookie.service';

class UniversalWorkQueueService {

    static fetchUWQRequest(reqData) {
        let authDetails = CookieManagerService.getAuthDetails();
        const transactionId = CookieManagerService.getItem(AppConstant.TRANSACTION_ID) || "12423435";
        const agentId = "B0043385" || authDetails.agentId || "";
        const url = Config.contextPath + "user/rest/v1.0/b2b/uwq?transactionId=" + transactionId + '&agentId=' + agentId;
        return CustomHttpService.get(url, {}, EncodeDecodeType.DEFAULT);
    }
}

export default UniversalWorkQueueService;
